import { useEffect, useState } from "react";

const CitiesAndCodes = () => {
  const [allCities, setAllCities] = useState([]);
  
  useEffect(() => {
    fetch("http://localhost:3000/", {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    }).then((response) =>
      response.json().then((data) => {
        setAllCities(data);
      })
    );
  }, []);
  return allCities;
};
